// src/components/Projects.js
import React from 'react';
import './Projects.css';
const Projects = () => {
    return (
        <div className="container-content">
            <h2>Projects</h2>
            <div>
                <h3>Task Manager<a href="https://github.com/Aellun" target="_blank">Aellun</a></h3>
                <p>Description:
                    Built with: python and Tkinter library
                    This an application that enable you organise your to do list
                    for the specified period you decide.</p>
            </div>
            <div>
                <h3>Password Genrator</h3>
                <p>Description of Project 2.</p>
            </div>
            <div>
                <h3>Project 2</h3>
                <p>Description of Project 2.</p>
            </div>
            {/* Add more projects as needed */}
        </div>
    );
};

export default Projects;
